import './App.css';

function App() {
  return (
    <div className="App">
      <h3>Who Are We?</h3>
      <p className="about">We Are a Black Owned Business focused on creating styles that are functional as.
      Our hair are our crown, and our skin is like shining armour. We deserve clothes built to protect and enrich them.
      That is why we created the Silk Collective, not only to focus on clothing that safeguards
      our hair and skin, but also to preserve and augment the culture and those who build it</p>
    </div>
  );
}

export default App;
